        (float)$remainingBalance = $initial_balance;
        (float)$balance_after_transaction = $initial_balance - $dailyTransactionAmount;
        $day === $arr[$t]['trans_plaid_date'];

        array_push($dailyUserBalanceForNinetyDays,["index"=>$i,"trans_plaid_date"=>$day,"trans_id"=>$trans_id,
        "dailyInitialBalance"=>$initial_balance,'trans_plaid_amount'=>$dailyTransactionAmount,'Daily closing balance'=>$balance_after_transaction]);

        (float)$totalClosingBalance += $dailyTransactionAmount;

        if($i <31){
         (float)$totalClosingBalance30Days += $dailyTransactionAmount;
        }
        if($i>60){
          (float)$totalClosingBalance60to90days += $dailyTransactionAmount;
        }
        (float)$initial_balance = $balance_after_transaction;
        (float)$day = $arr[$t]['trans_plaid_date'];
        (float)$previosTransaction = $arr[$t]['trans_plaid_amount'];
        (float)$dailyTransactionAmount = 0;
        $i++;
        if($i > 90){
            break;
        }
    }
    $average30Days = $totalClosingBalance30Days/30;
    $average90Days = $totalClosingBalance/90;
    $average1st60to90days = $totalClosingBalance60to90days/30;

    return [$dailyUserBalanceForNinetyDays,$average30Days, $average90Days,$average1st60to90days];
}

$ninetyDayBalance = dailyUserBalanceForNinetyDays($balanceAfterEveryTransaction);

