function sumIncomeOfLastThirtyDaysExceptId($arr, $id){
    (float)$income = 0;
    $i = 0;
    foreach($arr as $t => $y){
        if($i < 60){
            $i++;
            continue;
        }

        if( ($arr[$t]["trans_plaid_amount"] < 0) &&  ( $arr[$t]["trans_id"]  !==$id ) ){
            $income += abs($arr[$t]["trans_plaid_amount"]);
        }
        $i++;
    }

    return "Income of last 30 days = {$income} \n";
}

